import React from "react";
import { Link } from "react-router-dom";

export default (props) => ( 
    <div class = "single-event">
        <h2 className = "event-heading">Deliver a Pizza Ball</h2>
        <p className = "subtitle">Service Event</p>
        <p className = "single-event-description"> Help the officers deliver a pizza ball in the most effective, efficent , and timeliest manner possible</p>
        <p className = "subtitle">Tuesday, March 16th at 9:00 AM</p>
    </div>    
);
